import React, { Component, Fragment } from 'react';
import Props from './PropsReact';

// const dummyText = 'Props application (4)';
const dummyText = [
    {
        id: 1,
    namee: 'ismail',
    mobile: '01874631310'
    }
];
class PracticeReact extends Component{

    render(){
      return(
          <Fragment>
              <Props PropsReact={dummyText} />
          </Fragment>
      )
    }
}
export default PracticeReact;








